&lt;p&gt;Two statements are followed by three conclusions numbered I, II and III. Assuming the statements to be true, even if they do not conform to real-world knowledge, decide which of the conclusion(s) logically follows/follow from the statements.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statements: &lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;All knives are instruments.&lt;/p&gt;

&lt;p&gt;Some cutters are knives.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Conclusions: &lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;I. Some cutters are instruments.&lt;/p&gt;

&lt;p&gt;II. All knives are cutters.&lt;/p&gt;
III. Some knives are not instruments.

