&lt;p&gt;नीचे दिए गये प्रश्न में दो कथन और और उसके बाद I, II और III से अंकित तीन निष्कर्ष दिए गये हैं। आपको दिए गये कथनों को सत्य मानना है भले ही वे ज्ञात तथ्यों से अलग प्रतीत होते हों। निर्णय कीजिये कि कौन सा निष्कर्ष ज्ञात तथ्यों को नजरंदाज करने पर कथनों का तार्किक रूप से अनुसरण करता है।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;सभी चाकू उपकरण हैं।&lt;/p&gt;

&lt;p&gt;कुछ कटर चाकू हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;निष्कर्ष:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;I. कुछ कटर उपकरण हैं।&lt;/p&gt;

&lt;p&gt;II. सभी चाकू कटर हैं।&lt;/p&gt;
III. कुछ चाकू उपकरण नहीं हैं।

